import axios from 'axios';

const LIVRO_API_BASE_URL_LIVRO = "http://localhost:8070/livro";

class LivroService{

    getAllLivro(){
        return axios.get(LIVRO_API_BASE_URL_LIVRO);
    }

    createEmployee(livros){
        return axios.post(LIVRO_API_BASE_URL_LIVRO, livros);
    }



}

export default new LivroService()
